Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (1,'Davolio','Nancy','Sales Representative','Ms.','12/08/1968','05/01/1992', NULL, '507 - 20th Ave. E. Apt. 2A','Seattle','WA','98122','USA','(206) 555-9857','5467', 'ndavolio@nwtraders.com', 'Education includes a BA in psychology from Colorado State University in 1970.  She also completed "The Art of the Cold Call."  Nancy is a member of Toastmasters International.',2)
Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (2,'Fuller','Andrew','Vice President, Sales','Dr.','02/19/1962','08/14/1992', NULL, '908 W. Capital Way','Tacoma','WA','98401','USA','(206) 555-9482','3457','afuller@nwtraders.com','Andrew received his BTS commercial in 1974 and a Ph.D. in international marketing from the University of Dallas in 1981.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1992 and to vice president of sales in March 1993.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.',NULL)
Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (3,'Leverling','Janet','Sales Representative','Ms.','08/30/1973','04/01/1992', NULL, '722 Moss Bay Blvd.','Kirkland','WA','98033','USA','(206) 555-3412','3355','jleverling@nwtraders.com','Janet has a BS degree in chemistry from Boston College (1984).  She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.',2)
Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (4,'Peacock','Margaret','Sales Representative','Mrs.','09/19/1957','05/03/1993', NULL, '4110 Old Redmond Rd.','Redmond','WA','98052','USA','(206) 555-8122','5176', 'mpeacock@nwtraders.com', 'Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.',2)
Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (5,'Buchanan','Steven','Sales Manager','Mr.','03/04/1965','10/17/1993', NULL, '14 Garrett Hill','London',NULL,'SW1 8JR','UK','(71) 555-4848','3453','sbuchanan@nwtraders.com','Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1993.  Mr. Buchanan has completed the courses "Successful Telemarketing" and "International Sales Management."  He is fluent in French.',2)
Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (6,'Suyama','Michael','Sales Representative','Mr.','07/02/1973','10/17/1993', NULL, 'Coventry House Miner Rd.','London',NULL,'EC2 7JR','UK','(71) 555-7773','428','msuyama@nwtraders.com','Michael is a graduate of Sussex University (MA, economics, 1983) and the University of California at Los Angeles (MBA, marketing, 1986).  He has also taken the courses "Multi-Cultural Selling" and "Time Management for the Sales Professional."  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.',5)
Insert into Employees(EmployeeID, LastName, FirstName, JobTitle, Title, BirthDate, HireDate,TerminationDate, Address, City, StateOrRegion, PostalCode, Country, HomePhone, Extension, EmailAddress, Notes, ReportsTo) values (7,'King','Robert','Sales Representative','Mr.','05/29/1970','01/02/1994', NULL, 'Edgeham Hollow Winchester Way','London',NULL,'RG1 9SP','UK','(71) 555-5598','465','rking@nwtraders.com','Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992, the year he joined the company.  After completing a course entitled "Selling in Europe," he was transferred to the London office in March 1993.',5)
