
CREATE TABLE [dbo].[Categories](
	[CategoryID] [int] IDENTITY(1,1) NOT NULL,
	[CategoryName] [varchar](15) NOT NULL,
	[Description] [varchar](max) NULL,
 CONSTRAINT [PK_Categories] PRIMARY KEY (CategoryID)
 )

GO

CREATE TABLE [dbo].[Region](
	[RegionID] [int] NOT NULL,
	[RegionDescription] [varchar](50) NOT NULL,
 CONSTRAINT [PK_Region] PRIMARY KEY (RegionID)
)

GO

CREATE TABLE [dbo].[Territories](
	[TerritoryID] Char(5) NOT NULL,
	[TerritoryDescription] [varchar](50) NOT NULL,
	[RegionID] [int] NOT NULL,
 CONSTRAINT [PK_Territories] PRIMARY KEY (TerritoryID),
 CONSTRAINT [FK_Territories_Region] FOREIGN KEY([RegionID])
 REFERENCES [dbo].[Region] ([RegionID])
)
GO

CREATE TABLE [dbo].[Customers](
	[CustomerID] [char](5) NOT NULL,
	[CompanyName] [varchar](40) NOT NULL,
	[ContactName] [varchar](30) NULL,
	[ContactTitle] [varchar](30) NULL,
	[Address] [varchar](60) NULL,
	[City] [varchar](15) NULL,
	[StateOrRegion] [varchar](15) NULL,
	[PostalCode] [varchar](10) NULL,
	[Country] [varchar](15) NULL,
	[Phone] [varchar](24) NULL,
	[Fax] [varchar](24) NULL,
 CONSTRAINT [PK_Customers] PRIMARY KEY(	CustomerID)
 )

GO

CREATE TABLE [dbo].[Employees](
	[EmployeeID] [int] IDENTITY(1,1) NOT NULL,
	[LastName] [varchar](20) NOT NULL,
	[FirstName] [varchar](10) NOT NULL,
	[JobTitle] [varchar](30) NULL,
	[Title] [varchar](25) NULL,
	[BirthDate] [date] NULL,
	[HireDate] [date] NOT NULL,
	[TerminationDate] [date] NULL,
	[Address] [varchar](60) NULL,
	[City] [varchar](15) NULL,
	[StateOrRegion] [varchar](15) NULL,
	[PostalCode] [varchar](10) NULL,
	[Country] [varchar](15) NULL,
	[HomePhone] [varchar](24) NULL,
	[Extension] [varchar](4) NULL,
	[EmailAddress] [varchar](100) NOT NULL,
	[Notes] [varchar](Max) NULL,
	[ReportsTo] [int] NULL,
 CONSTRAINT [PK_Employees] PRIMARY KEY (EmployeeID)
)
GO

CREATE TABLE [dbo].[Shippers](
	[ShipperID] [int] IDENTITY(1,1) NOT NULL,
	[CompanyName] [varchar](40) NOT NULL,
	[Phone] [varchar](24) NULL,
 CONSTRAINT [PK_Shippers] PRIMARY KEY (ShipperID) 
 )
GO

CREATE TABLE [dbo].[Suppliers](
	[SupplierID] [int] IDENTITY(1,1) NOT NULL,
	[CompanyName] [varchar](40) NOT NULL,
	[ContactName] [varchar](30) NULL,
	[ContactTitle] [varchar](30) NULL,
	[Address] [varchar](60) NULL,
	[City] [varchar](15) NULL,
	[StateOrRegion] [varchar](15) NULL,
	[PostalCode] [varchar](10) NULL,
	[Country] [varchar](15) NULL,
	[Phone] [varchar](24) NULL,
	[Fax] [varchar](24) NULL
 CONSTRAINT [PK_Suppliers] PRIMARY KEY (SupplierID)
 )
 GO

CREATE TABLE [dbo].[Products](
	[ProductID] [int] IDENTITY(1,1) NOT NULL,
	[ProductName] [varchar](40) NOT NULL,
	[SupplierID] [int] NOT NULL,
	[CategoryID] [int] NOT NULL,
	[QuantityPerUnit] [varchar](20) NULL,
	[UnitPrice] [money] NULL CONSTRAINT [DF_Products_UnitPrice]  DEFAULT (0),
	[WholesalePrice] [money] NULL CONSTRAINT [DF_Products_WholesalePrice]  DEFAULT (0),
	[UnitsInStock] [smallint] NULL CONSTRAINT [DF_Products_UnitsInStock]  DEFAULT (0),
	[UnitsOnOrder] [smallint] NULL CONSTRAINT [DF_Products_UnitsOnOrder]  DEFAULT (0),
	[ReorderLevel] [smallint] NULL CONSTRAINT [DF_Products_ReorderLevel]  DEFAULT (0),
	[Discontinued] [bit] NOT NULL CONSTRAINT [DF_Products_Discontinued]  DEFAULT (0),
 CONSTRAINT [PK_Products] PRIMARY KEY(ProductID),
 CONSTRAINT [FK_Products_Categories] FOREIGN KEY([CategoryID])
 REFERENCES [dbo].[Categories] ([CategoryID]),
 CONSTRAINT [FK_Products_Suppliers] FOREIGN KEY([SupplierID])
 REFERENCES [dbo].[Suppliers] ([SupplierID]),
 CONSTRAINT [CK_Products_UnitPrice] CHECK  (([UnitPrice] >= 0)),
 CONSTRAINT [CK_Products_WholesalePrice] CHECK  (([WholesalePrice] >= 0)),
 CONSTRAINT [CK_ReorderLevel] CHECK  (([ReorderLevel] >= 0)),
 CONSTRAINT [CK_UnitsInStock] CHECK  (([UnitsInStock] >= 0)),
 CONSTRAINT [CK_UnitsOnOrder] CHECK  (([UnitsOnOrder] >= 0))
 )
GO

CREATE TABLE [dbo].[EmployeeTerritories](
	[EmployeeID] [int] NOT NULL,
	[TerritoryID] [char](5) NOT NULL,
 CONSTRAINT [PK_EmployeeTerritories] PRIMARY KEY(EmployeeID,TerritoryID),
 CONSTRAINT [FK_EmployeeTerritories_Employees] FOREIGN KEY([EmployeeID])
 REFERENCES [dbo].[Employees] ([EmployeeID]),
 CONSTRAINT [FK_EmployeeTerritories_Territories] FOREIGN KEY([TerritoryID])
 REFERENCES [dbo].[Territories] ([TerritoryID])
 )

GO

CREATE TABLE [dbo].[Orders](
	[OrderID] [int] IDENTITY(1,1) NOT NULL,
	[CustomerID] [char](5) NOT NULL,
	[EmployeeID] [int] NOT NULL,
	[OrderDate] [datetime] NOT NULL,
	[RequiredDate] [datetime] NULL,
	[ShippedDate] [datetime] NULL,
	[ShipVia] [int] NOT NULL,
	[Freight] [money] NULL CONSTRAINT [DF_Orders_Freight]  DEFAULT (0),
	[ShipName] [varchar](40) NULL,
	[ShipAddress] [varchar](60) NULL,
	[ShipCity] [varchar](15) NULL,
	[ShipStateOrRegion] [varchar](15) NULL,
	[ShipPostalCode] [varchar](10) NULL,
	[ShipCountry] [varchar](15) NULL,
 CONSTRAINT [PK_Orders] PRIMARY KEY(OrderID),
 CONSTRAINT [FK_Orders_Customers] FOREIGN KEY([CustomerID])
 REFERENCES [dbo].[Customers] ([CustomerID]),
 CONSTRAINT [FK_Orders_Employees] FOREIGN KEY([EmployeeID])
 REFERENCES [dbo].[Employees] ([EmployeeID]),
 CONSTRAINT [FK_Orders_Shippers] FOREIGN KEY([ShipVia])
 REFERENCES [dbo].[Shippers] ([ShipperID])
)

GO

CREATE TABLE [dbo].[OrderDetails](
	[OrderID] [int] NOT NULL,
	[ProductID] [int] NOT NULL,
	[UnitPrice] [money] NOT NULL CONSTRAINT [DF_Order_Details_UnitPrice]  DEFAULT (0),
	[Quantity] [smallint] NOT NULL CONSTRAINT [DF_Order_Details_Quantity]  DEFAULT (1),
	[Discount] [Decimal](3,2) NOT NULL CONSTRAINT [DF_Order_Details_Discount]  DEFAULT (0),
 CONSTRAINT [PK_Order_Details] PRIMARY KEY(	[OrderID] ,	[ProductID]),
 CONSTRAINT [FK_Order_Details_Orders] FOREIGN KEY([OrderID])
 REFERENCES [dbo].[Orders] ([OrderID]),
 CONSTRAINT [FK_Order_Details_Products] FOREIGN KEY([ProductID])
 REFERENCES [dbo].[Products] ([ProductID]),
 CONSTRAINT [CK_Discount] CHECK  (([Discount] >= 0 and [Discount] <= 1)),
 CONSTRAINT [CK_Quantity] CHECK  (([Quantity] > 0)),
 CONSTRAINT [CK_UnitPrice] CHECK  (([UnitPrice] >= 0))
)
GO

