declare @orderid as int
select @orderid = SCOPE_IDENTITY()

select @orderid, productid, unitprice, round(unitprice * .1, 0), 0.00 from products
where productid in (7,14,4,67)


update products
set wholesaleprice  =
cast(Case when UnitPrice < 12 then UnitPrice *.9 
when ProductName like '%Lager' or productName like '%Ale' or ProductName like '%stout' or ProductName like '%bier' then UnitPrice * .6 
When ProductName like '%spread%' or productName like '%syrup%' or productName like '%sauce%' or productName like '%Soße%' then UnitPrice *.78 
when c.CategoryID in(3, 4) and UnitPrice > 40 then UnitPrice *.82 
When c.categoryID in(4, 5) and UnitPrice between 25 and 40 then UnitPrice *.73
when c.categoryID in(6, 8) and UnitPrice between 20 and 60 then UnitPrice *.62
when ProductName like '%dried%' then UnitPrice * .88
when p.SupplierID = 6 then UnitPrice *.77
when p.SupplierID = 7 then UnitPrice *.68
when p.SupplierID = 17 then UnitPrice *.67
when p.SupplierID = 20 then UnitPrice *.55
when p.SupplierID = 23 then UnitPrice *.72
When ProductName = 'Côte de Blaye' then UnitPrice *.92
When ProductName = 'Thüringer Rostbratwurst' then UnitPrice *.89
When productName = 'Mishi Kobe Niku' then UnitPrice *.915
When s.Country = 'Germany' then UnitPrice *.885
When s.Country = 'Italy' then UnitPrice *.781
When s.Country = 'USA' then UnitPrice * .905
When c.CategoryID = 1 then UnitPrice *.72
when c.CategoryId = 3 then UnitPrice * .843
When c.CategoryID = 8 then UnitPrice *.727
else UnitPrice * .8
end as Decimal(6,2)) 
From Products p
join categories c
on p.CategoryID = c.CategoryID
Join Suppliers s
on p.supplierID = s.SupplierId

 